import React, { useState } from 'react';
import './index.css';



function App(){
    const vstate = useState();

    const [count] = useState(60);
 
    

    return (
        <React.Fragment>        
        <h1 >{count}</h1>
        
      </React.Fragment>
    )
}

export default App;
